import { useSelector } from "react-redux";


export function useSelector1(arr:allStoreType[]){
    let x1 = useSelector<IStore,any>(store=>store[arr[0]])
    return [x1];

}
export  function useSelector2(arr:allStoreType[]){
    let x1 = useSelector<IStore,any>(store=>store[arr[0]])
    let x2 = useSelector<IStore,any>(store=>store[arr[1]])

    return [x1,x2];
}

export function useSelector3(arr:allStoreType[]){
    let x1 = useSelector<IStore,any>(store=>store[arr[0]])
    let x2 = useSelector<IStore,any>(store=>store[arr[1]])
    let x3 = useSelector<IStore,any>(store=>store[arr[2]])
    return [x1,x2,x3];
}

export function useSelector4(arr:allStoreType[]){
    let x1 = useSelector<IStore,any>(store=>store[arr[0]])
    let x2 = useSelector<IStore,any>(store=>store[arr[1]])
    let x3 = useSelector<IStore,any>(store=>store[arr[2]])
    let x4 = useSelector<IStore,any>(store=>store[arr[3]])
    return [x1,x2,x3,x4];
}
